import React from "react";
import "../../App.css";
import CardItem from "../elements/CardItem";

export default function Recipes() {
  return (
    <>
      <h1 className="recipes">Chicken Recipe</h1>
      <div className="container">
        <div col col-lg-2>
          <button type="button">
            <div>
              <img src="images/chickenPic.jpeg" height={100}></img> text="Taste delicious restaurant
              style cuisine from your home or dorm room" label="Savory and Spicy
              Dishes" path="/recipes"
            </div>
          </button>
        </div>
      </div>
    </>
  );
}
